import {BrowserRouter as Router, Route, Switch, Link} from "react-router-dom"
import Home from "./views/Home";
import './App.css';

function App() { 
    return (   
    <div className="App">

      <Router>
        <Link to="">Criar um novo Poste</Link>
        <Switch>
          <Route path="/" exact component={Home}/>
          <Route path="/" exact component={Home}/>

        </Switch>
      </Router>      
      </div>
    );  
}

export default App;
